import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const container = {
  height : "200px",
  width : "500px",
  background : "#fff999",
  display : "flex",
  justifyContent : "center",
  alignItems : "center",
  marginTop : "120px",
  flexDirection : "column"
}

const root = document.getElementById('root');
let name = "Earthrelmer";

ReactDOM.render(
  <div style={container}>
  <h1>Helo {name}</h1>
  <input type="text" />
  </div>,
  root
);
